import '../index.css';

const TaskInput = () => {

    return(
        <div className="flex flex-row items-center">
            {/* <input type="checkbox" className="w-4 h-4 rounded-full focus:ring-1" /> */}
            <button type="button" className="bg-white rounded-full p items-center justify-center text-gray-500 hover:text-gray-500 hover:bg-gray-100 focus:outline-none focus:ring-2 focus:ring-inset focus:ring-indigo-500">
              <span className="sr-only">Close menu</span>
              <svg className="h-2 w-2" xmlns="http://www.w3.org/2000/svg" fill="none" viewBox="0 0 24 24" stroke="currentColor" aria-hidden="true">
                <path stroke-linecap="round" stroke-linejoin="round" stroke-width="2" d="M6 18L18 6M6 6l12 12" />
              </svg>
            </button>
            <div className="ml-3 flex flex-col">
                <input className="border-0 p-0 text-base font-medium focus:ring-0" placeholder="Enter Task Name" type="text"></input>
                <input className="text-xs text-gray-500 p-0 border-0 focus:ring-0" placeholder="Task Description" type="text"></input>
            </div>
        </div>
    );
};

export default TaskInput;
